import React, { useState, useEffect } from "react";

const Event = (props) => {
  const [events, setEvents] = useState([]);

  useEffect(
    () => {
      fetch('/api/events').then(
        res => res.json()
      ).then(
        events => {
          console.log(events.events);
          setEvents(events);
        }
      )
    },[]
  );
    return (
        <div className="container c-col">
         <ul>
          { events.length? 
            events.events.map( event => {
              <li>{event.summary}</li>
            }

            ) : ''
          }
         </ul>
        </div>
      );
};
export default Event;
